// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import {ICandidateDatabase} from "./interfaces/ICandidateDatabase.sol";

/**
 * @title CandidateDatabase Contract
 * @author Masum Reza
 * @notice This contract allows candidates to self-register and update their profiles.
 * @dev Only the admin (owner) can delete/unregister candidates. Anyone can view public candidate data.
 */

/// @notice Thrown when a candidate under the age of 18 tries to register
error CandidateDatabase__NotEligible();

/// @notice Thrown when a non-owner attempts to perform an admin-only action
error CandidateDatabase__NotOwner();

/// @notice Thrown when a candidate attempts to register again after already being registered
error CandidateDatabase__AlreadyRegistered();

/// @notice Thrown when an unregistered candidate attempts a restricted action
error CandidateDatabase__NotRegistered();

/// @notice Thrown when import operations fail
error CandidateDatabase__ImportFailed();

/// @notice Thrown when an invalid address is provided
error CandidateDatabase__InvalidAddress();

/// @notice Thrown when a non-admin tries to access admin functionality
error CandidateDatabase__NotAdmin();

/// @notice Thrown when trying to add an address that's already an admin
error CandidateDatabase__AlreadyAdmin();

/// @notice Thrown when trying to remove an address that's not an admin
error CandidateDatabase__AdminNotFound();

contract CandidateDatabase is ICandidateDatabase {
    /// @notice Candidate struct holding personal information and registration status
    struct Candidate {
        string name;
        uint256 age;
        Gender gender;
        string presentAddress;
        string email;
        string qualifications;
        string manifesto;
        uint256 registrationTimestamp;
        bool isRegistered;
    }

    address private immutable i_owner;
    mapping(address => Candidate) private s_candidates;
    address[] private s_candidateAddresses;

    // Admin system
    mapping(address => bool) private s_admins;
    address[] private s_adminAddresses;

    /// @notice Modifier to restrict access to contract owner (admin)
    modifier onlyOwner() {
        if (msg.sender != i_owner) revert CandidateDatabase__NotOwner();
        _;
    }

    /// @notice Modifier to restrict access to registered candidates only
    modifier onlyRegistered() {
        if (!s_candidates[msg.sender].isRegistered)
            revert CandidateDatabase__NotRegistered();
        _;
    }

    /// @notice Restricts function access to admins (including the owner)
    modifier onlyAdmin() {
        if (msg.sender != i_owner && !s_admins[msg.sender])
            revert CandidateDatabase__NotAdmin();
        _;
    }

    /// @notice Contract constructor sets the deployer as the owner
    constructor() {
        i_owner = msg.sender;
    }

    /// @notice Register yourself as a candidate
    /// @param _name Candidate's full name
    /// @param _age Candidate's age (must be 18+)
    /// @param _gender Candidate's gender (0 for Male, 1 for Female)
    /// @param _presentAddress Candidate's current address
    /// @param _email Candidate's email address
    /// @param _qualifications Candidate's educational qualifications
    /// @param _manifesto Candidate's election manifesto or platform
    function addCandidate(
        string memory _name,
        uint256 _age,
        Gender _gender,
        string memory _presentAddress,
        string memory _email,
        string memory _qualifications,
        string memory _manifesto
    ) public override {
        if (_age < 18) revert CandidateDatabase__NotEligible();
        if (s_candidates[msg.sender].isRegistered)
            revert CandidateDatabase__AlreadyRegistered();

        s_candidates[msg.sender] = Candidate({
            name: _name,
            age: _age,
            gender: _gender,
            presentAddress: _presentAddress,
            email: _email,
            qualifications: _qualifications,
            manifesto: _manifesto,
            registrationTimestamp: block.timestamp,
            isRegistered: true
        });
        s_candidateAddresses.push(msg.sender);
        emit CandidateRegistered(msg.sender);
    }

    /// @notice Update your candidate profile
    /// @param _name Updated name
    /// @param _age Updated age
    /// @param _gender Updated gender
    /// @param _presentAddress Updated present address
    /// @param _email Updated email address
    /// @param _qualifications Updated qualifications
    /// @param _manifesto Updated manifesto
    function updateCandidate(
        string memory _name,
        uint256 _age,
        Gender _gender,
        string memory _presentAddress,
        string memory _email,
        string memory _qualifications,
        string memory _manifesto
    ) public override onlyRegistered {
        s_candidates[msg.sender].name = _name;
        s_candidates[msg.sender].age = _age;
        s_candidates[msg.sender].gender = _gender;
        s_candidates[msg.sender].presentAddress = _presentAddress;
        s_candidates[msg.sender].email = _email;
        s_candidates[msg.sender].qualifications = _qualifications;
        s_candidates[msg.sender].manifesto = _manifesto;

        emit CandidateUpdated(msg.sender);
    }

    /// @notice Delete a candidate's registration (admin only)
    /// @param _candidateAddress The address of the candidate to remove
    function deleteCandidate(
        address _candidateAddress
    ) public override onlyAdmin {
        if (!s_candidates[_candidateAddress].isRegistered) {
            revert CandidateDatabase__NotRegistered();
        }

        delete s_candidates[_candidateAddress];

        for (uint256 i = 0; i < s_candidateAddresses.length; i++) {
            if (s_candidateAddresses[i] == _candidateAddress) {
                s_candidateAddresses[i] = s_candidateAddresses[
                    s_candidateAddresses.length - 1
                ];
                s_candidateAddresses.pop();
                break;
            }
        }

        emit CandidateDeleted(_candidateAddress);
    }

    /// @notice Admin function to add a candidate directly
    /// @dev Only owner/admins can call this function
    /// @param _candidateAddress Address of the candidate to add
    /// @param _name Name of the candidate
    /// @param _age Age of the candidate
    /// @param _gender Gender of the candidate
    /// @param _presentAddress Present address of the candidate
    /// @param _email Email of the candidate
    /// @param _qualifications Qualifications of the candidate
    /// @param _manifesto Manifesto of the candidate
    function adminAddCandidate(
        address _candidateAddress,
        string memory _name,
        uint256 _age,
        Gender _gender,
        string memory _presentAddress,
        string memory _email,
        string memory _qualifications,
        string memory _manifesto
    ) external override onlyAdmin {
        if (_candidateAddress == address(0))
            revert CandidateDatabase__InvalidAddress();
        if (_age < 18) revert CandidateDatabase__NotEligible();

        // Check if already registered
        if (s_candidates[_candidateAddress].isRegistered)
            revert CandidateDatabase__AlreadyRegistered();

        s_candidates[_candidateAddress] = Candidate({
            name: _name,
            age: _age,
            gender: _gender,
            presentAddress: _presentAddress,
            email: _email,
            qualifications: _qualifications,
            manifesto: _manifesto,
            registrationTimestamp: block.timestamp,
            isRegistered: true
        });

        s_candidateAddresses.push(_candidateAddress);

        emit AdminAddedCandidate(_candidateAddress, msg.sender);
    }

    /// @notice Admin function to update candidate details
    /// @dev Only owner/admins can call this function
    /// @param _candidateAddress Address of the candidate to update
    /// @param _name Updated name
    /// @param _age Updated age
    /// @param _gender Updated gender
    /// @param _presentAddress Updated present address
    /// @param _email Updated email
    /// @param _qualifications Updated qualifications
    /// @param _manifesto Updated manifesto
    function adminUpdateCandidate(
        address _candidateAddress,
        string memory _name,
        uint256 _age,
        Gender _gender,
        string memory _presentAddress,
        string memory _email,
        string memory _qualifications,
        string memory _manifesto
    ) external override onlyAdmin {
        if (!s_candidates[_candidateAddress].isRegistered)
            revert CandidateDatabase__NotRegistered();

        Candidate storage candidate = s_candidates[_candidateAddress];

        // Update details but preserve timestamp
        candidate.name = _name;
        candidate.age = _age;
        candidate.gender = _gender;
        candidate.presentAddress = _presentAddress;
        candidate.email = _email;
        candidate.qualifications = _qualifications;
        candidate.manifesto = _manifesto;

        emit AdminUpdatedCandidate(_candidateAddress, msg.sender);
    }

    /// @notice Import a specific candidate from another CandidateDatabase contract
    /// @dev Only owner/admins can call this function
    /// @param _sourceContract The address of the source CandidateDatabase contract
    /// @param _candidateAddress The address of the candidate to import
    function adminImportCandidate(
        address _sourceContract,
        address _candidateAddress
    ) external override onlyAdmin {
        // Skip if candidate is already registered in this contract
        if (s_candidates[_candidateAddress].isRegistered) {
            revert CandidateDatabase__AlreadyRegistered();
        }

        ICandidateDatabase source = ICandidateDatabase(_sourceContract);

        try source.getCandidateDetails(_candidateAddress) returns (
            string memory name,
            uint256 age,
            Gender gender,
            string memory presentAddress,
            string memory email,
            string memory qualifications,
            string memory manifesto,
            uint256 registrationTimestamp
        ) {
            // Add candidate to this contract
            s_candidates[_candidateAddress] = Candidate({
                name: name,
                age: age,
                gender: gender,
                presentAddress: presentAddress,
                email: email,
                qualifications: qualifications,
                manifesto: manifesto,
                registrationTimestamp: registrationTimestamp,
                isRegistered: true
            });

            s_candidateAddresses.push(_candidateAddress);
            emit CandidateRegistered(_candidateAddress);

            uint256 importedCount = 1;
            emit CandidatesImported(_sourceContract, importedCount);
        } catch {
            revert CandidateDatabase__ImportFailed();
        }
    }

    /// @notice Batch import selected candidates from another CandidateDatabase contract
    /// @dev Only owner/admins can call this function
    /// @param _sourceContract The address of the source CandidateDatabase contract
    /// @param _candidateAddresses Array of candidate addresses to import
    function adminBatchImportCandidates(
        address _sourceContract,
        address[] calldata _candidateAddresses
    ) external override onlyAdmin {
        ICandidateDatabase source = ICandidateDatabase(_sourceContract);
        uint256 importedCount = 0;

        for (uint256 i = 0; i < _candidateAddresses.length; i++) {
            address candidateAddress = _candidateAddresses[i];

            // Skip if candidate is already registered
            if (s_candidates[candidateAddress].isRegistered) {
                continue;
            }

            try source.getCandidateDetails(candidateAddress) returns (
                string memory name,
                uint256 age,
                Gender gender,
                string memory presentAddress,
                string memory email,
                string memory qualifications,
                string memory manifesto,
                uint256 registrationTimestamp
            ) {
                // Add candidate to this contract
                s_candidates[candidateAddress] = Candidate({
                    name: name,
                    age: age,
                    gender: gender,
                    presentAddress: presentAddress,
                    email: email,
                    qualifications: qualifications,
                    manifesto: manifesto,
                    registrationTimestamp: registrationTimestamp,
                    isRegistered: true
                });

                s_candidateAddresses.push(candidateAddress);
                emit CandidateRegistered(candidateAddress);
                importedCount++;
            } catch {
                // Continue to next candidate if this one fails
                continue;
            }
        }

        emit CandidatesImported(_sourceContract, importedCount);
    }

    /// @notice Import all candidates from another CandidateDatabase contract
    /// @dev Only owner/admins can call this function
    /// @param _sourceContract The address of the source CandidateDatabase contract
    function adminImportAllCandidates(
        address _sourceContract
    ) external override onlyAdmin {
        ICandidateDatabase source = ICandidateDatabase(_sourceContract);
        address[] memory candidates;

        // Use try/catch to handle potential errors from external calls
        try source.getAllCandidates() returns (address[] memory _candidates) {
            candidates = _candidates;
        } catch {
            revert CandidateDatabase__ImportFailed();
        }

        uint256 importedCount = 0;

        for (uint256 i = 0; i < candidates.length; i++) {
            address candidateAddress = candidates[i];

            // Skip if candidate is already registered in this contract
            if (s_candidates[candidateAddress].isRegistered) {
                continue;
            }

            try source.getCandidateDetails(candidateAddress) returns (
                string memory name,
                uint256 age,
                Gender gender,
                string memory presentAddress,
                string memory email,
                string memory qualifications,
                string memory manifesto,
                uint256 registrationTimestamp
            ) {
                // Add candidate to this contract
                s_candidates[candidateAddress] = Candidate({
                    name: name,
                    age: age,
                    gender: gender,
                    presentAddress: presentAddress,
                    email: email,
                    qualifications: qualifications,
                    manifesto: manifesto,
                    registrationTimestamp: registrationTimestamp,
                    isRegistered: true
                });

                s_candidateAddresses.push(candidateAddress);
                emit CandidateRegistered(candidateAddress);
                importedCount++;
            } catch {
                // Continue to next candidate if this one fails
                continue;
            }
        }

        emit CandidatesImported(_sourceContract, importedCount);
    }

    /// @notice Add a new admin to the system
    /// @dev Only owner can call this function
    /// @param _adminAddress Address to be added as admin
    function addAdmin(address _adminAddress) external override onlyOwner {
        if (_adminAddress == address(0))
            revert CandidateDatabase__InvalidAddress();
        if (s_admins[_adminAddress]) revert CandidateDatabase__AlreadyAdmin();

        s_admins[_adminAddress] = true;
        s_adminAddresses.push(_adminAddress);

        emit AdminAdded(_adminAddress, msg.sender);
    }

    /// @notice Remove an admin from the system
    /// @dev Only owner can call this function
    /// @param _adminAddress Address to be removed from admin role
    function removeAdmin(address _adminAddress) external override onlyOwner {
        if (!s_admins[_adminAddress]) revert CandidateDatabase__AdminNotFound();

        // Remove admin from mapping
        delete s_admins[_adminAddress];

        // Remove from the admin array using swap and pop
        for (uint256 i = 0; i < s_adminAddresses.length; i++) {
            if (s_adminAddresses[i] == _adminAddress) {
                s_adminAddresses[i] = s_adminAddresses[
                    s_adminAddresses.length - 1
                ];
                s_adminAddresses.pop();
                break;
            }
        }

        emit AdminRemoved(_adminAddress, msg.sender);
    }

    /// @notice Check if an address is an admin
    /// @param _address Address to check
    /// @return True if the address is an admin, false otherwise
    function isAdmin(address _address) public view override returns (bool) {
        return _address == i_owner || s_admins[_address];
    }

    /// @notice Get the total number of admins (excluding owner)
    /// @return The count of admins
    function getAdminCount() public view override returns (uint256) {
        return s_adminAddresses.length;
    }

    /// @notice Get addresses of all admins (excluding owner)
    /// @return Array of admin addresses
    function getAllAdmins() public view override returns (address[] memory) {
        return s_adminAddresses;
    }

    /// @notice Get the contract owner address
    /// @return The address of the contract owner
    function getOwner() public view override returns (address) {
        return i_owner;
    }

    /// @notice Check if the caller is an admin
    /// @return True if the caller is an admin, false otherwise
    function amIAdmin() public view override returns (bool) {
        return isAdmin(msg.sender);
    }

    /// @notice Get full details of a specific candidate
    /// @param _candidateAddress Address of the candidate
    /// @return name The name of the candidate
    /// @return age The age of the candidate
    /// @return gender The gender of the candidate
    /// @return presentAddress The present address of the candidate
    /// @return email The email address of the candidate
    /// @return qualifications The qualifications of the candidate
    /// @return manifesto The election manifesto of the candidate
    /// @return registrationTimestamp When the candidate registered
    function getCandidateDetails(
        address _candidateAddress
    )
        public
        view
        override
        returns (
            string memory name,
            uint256 age,
            Gender gender,
            string memory presentAddress,
            string memory email,
            string memory qualifications,
            string memory manifesto,
            uint256 registrationTimestamp
        )
    {
        if (!s_candidates[_candidateAddress].isRegistered) {
            revert CandidateDatabase__NotRegistered();
        }
        Candidate memory candidate = s_candidates[_candidateAddress];
        return (
            candidate.name,
            candidate.age,
            candidate.gender,
            candidate.presentAddress,
            candidate.email,
            candidate.qualifications,
            candidate.manifesto,
            candidate.registrationTimestamp
        );
    }

    /// @notice Get the list of all registered candidate addresses
    /// @return Array of candidate wallet addresses
    function getAllCandidates()
        public
        view
        override
        returns (address[] memory)
    {
        return s_candidateAddresses;
    }

    /// @notice Get your full candidate details
    /// @return name Your name
    /// @return age Your age
    /// @return gender Your gender
    /// @return presentAddress Your present address
    /// @return email Your email
    /// @return qualifications Your qualifications
    /// @return manifesto Your election manifesto
    /// @return registrationTimestamp When you registered
    function getMyCandidateDetails()
        public
        view
        override
        onlyRegistered
        returns (
            string memory name,
            uint256 age,
            Gender gender,
            string memory presentAddress,
            string memory email,
            string memory qualifications,
            string memory manifesto,
            uint256 registrationTimestamp
        )
    {
        Candidate memory candidate = s_candidates[msg.sender];
        return (
            candidate.name,
            candidate.age,
            candidate.gender,
            candidate.presentAddress,
            candidate.email,
            candidate.qualifications,
            candidate.manifesto,
            candidate.registrationTimestamp
        );
    }

    /// @notice Get your own registration status
    /// @return isRegistered Whether you are registered for a election
    function getMyRegistrationStatus()
        public
        view
        override
        returns (bool isRegistered)
    {
        return s_candidates[msg.sender].isRegistered;
    }

    /// @notice Get a candidate's registration status
    /// @param _candidateAddress Address of the candidate
    /// @return isRegistered Whether the candidate is registered for a election
    function getCandidateRegistrationStatus(
        address _candidateAddress
    ) public view override returns (bool isRegistered) {
        return s_candidates[_candidateAddress].isRegistered;
    }

    /// @notice Get number of registered candidates
    /// @return count The number of registered candidates
    function getCandidateCount() public view override returns (uint256 count) {
        return s_candidateAddresses.length;
    }
}

contracts/ElectionDatabase.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

/**
 * @title ElectionDatabase
 * @notice Handles creation, management, and voting of elections using external voter and candidate databases.
 */

import {IVoterDatabase} from "contracts/interfaces/IVoterDatabase.sol";
import {ICandidateDatabase} from "contracts/interfaces/ICandidateDatabase.sol";

error ElectionDatabase__NotOwner();
error ElectionDatabase__NotRegisteredVoter();
error ElectionDatabase__AlreadyVoted();
error ElectionDatabase__ElectionNotFound();
error ElectionDatabase__CandidateNotRegistered();
error ElectionDatabase__VotingClosed();

contract ElectionDatabase {
    struct Election {
        string name;
        string description;
        // address of candidates who are also registered in CandidateDatabase
        address[] candidates;
        // candidate -> votes to that candidate
        mapping(address => uint256) votesPerCandidate;
        // voter -> who they voted for
        mapping(address => address) voterToChosenCandidate;
        // voter -> whether they have voted
        mapping(address => bool) voterHasVoted;
        // flag to determine whether an election is valid/registered
        bool isRegistered;
        // used to track whether the election is active or not
        bool isActive;
        uint256 totalVotes;
    }

    address private immutable i_owner;
    IVoterDatabase private immutable s_voterDB;
    ICandidateDatabase private immutable s_candidateDB;

    uint256 private s_electionCounter;
    mapping(uint256 => Election) private s_elections;

    /// @notice Emitted when a new election is created
    event ElectionCreated(uint256 indexed electionId, string name);

    /// @notice Emitted when a candidate is added to an election
    event CandidateAdded(uint256 indexed electionId, address indexed candidate);

    /// @notice Emitted when a voter votes for a candidate
    event VoterVoted(
        uint256 indexed electionId,
        address indexed voter,
        address indexed candidate
    );

    /// @notice Emitted when an election is opened for voting
    event ElectionOpened(uint256 indexed electionId);

    /// @notice Emitted when an election is closed
    event ElectionClosed(uint256 indexed electionId);

    modifier onlyOwner() {
        if (msg.sender != i_owner) revert ElectionDatabase__NotOwner();
        _;
    }

    modifier onlyRegisteredElection(uint256 _electionId) {
        if (!s_elections[_electionId].isRegistered)
            revert ElectionDatabase__ElectionNotFound();
        _;
    }

    modifier onlyRegisteredVoter() {
        if (!s_voterDB.getMyRegistrationStatus()) {
            revert ElectionDatabase__NotRegisteredVoter();
        }
        _;
    }

    modifier onlyRegisteredCandidate(uint256 _electionId, address _candidate) {
        if (!s_candidateDB.getCandidateRegistrationStatus(_candidate)) {
            revert ElectionDatabase__CandidateNotRegistered();
        }

        Election storage election = s_elections[_electionId];
        bool validCandidate = false;
        for (uint256 i = 0; i < election.candidates.length; i++) {
            if (election.candidates[i] == _candidate) {
                validCandidate = true;
                break;
            }
        }
        if (!validCandidate) revert ElectionDatabase__CandidateNotRegistered();
        _;
    }

    modifier onlyActiveElection(Election storage _election) {
        if (!_election.isActive) revert ElectionDatabase__VotingClosed();
        _;
    }

    /// @param _voterDBAddress Address of the VoterDatabase contract
    /// @param _candidateDBAddress Address of the CandidateDatabase contract
    constructor(address _voterDBAddress, address _candidateDBAddress) {
        i_owner = msg.sender;
        s_voterDB = IVoterDatabase(_voterDBAddress);
        s_candidateDB = ICandidateDatabase(_candidateDBAddress);
        s_electionCounter = 0;
    }

    /// @notice Creates a new election with given name and description
    function createElection(
        string memory _name,
        string memory _description
    ) external onlyOwner {
        uint256 electionId = s_electionCounter;

        Election storage newElection = s_elections[electionId];
        newElection.name = _name;
        newElection.description = _description;
        newElection.isActive = false;
        newElection.isRegistered = true;
        newElection.totalVotes = 0;

        s_electionCounter++;
        emit ElectionCreated(electionId, _name);
    }

    /// @notice Adds a candidate to a registered election
    /// @dev Only callable by contract owner
    /// @param _electionId ID of the election
    /// @param _candidate Address of the candidate to add
    // TODO: decide if this needs to be a onlyOwner function
    function addCandidate(
        uint256 _electionId,
        address _candidate
    ) external onlyOwner onlyRegisteredElection(_electionId) {
        if (!s_candidateDB.getCandidateRegistrationStatus(_candidate)) {
            revert ElectionDatabase__CandidateNotRegistered();
        }

        Election storage election = s_elections[_electionId];
        election.candidates.push(_candidate);

        emit CandidateAdded(_electionId, _candidate);
    }

    /// @notice Toggles the voting status (open/close) of an election
    /// @param _electionId ID of the election
    function toggleElectionStatus(
        uint256 _electionId
    ) external onlyOwner onlyRegisteredElection(_electionId) {
        Election storage election = s_elections[_electionId];
        if (!election.isActive) {
            election.isActive = true;
            emit ElectionOpened(_electionId);
        } else {
            election.isActive = false;
            emit ElectionClosed(_electionId);
        }
    }

    /// @notice Allows a registered voter to vote for a candidate in an active election
    /// @param _electionId ID of the election
    /// @param _candidate Address of the candidate to vote for
    // TODO: markVoted can only be called by owner, investigate that
    function vote(
        uint256 _electionId,
        address _candidate
    )
        external
        onlyActiveElection(s_elections[_electionId])
        onlyRegisteredCandidate(_electionId, _candidate)
        onlyRegisteredVoter
    {
        if (!s_voterDB.getMyRegistrationStatus())
            revert ElectionDatabase__NotRegisteredVoter();

        Election storage election = s_elections[_electionId];
        if (election.voterHasVoted[msg.sender])
            revert ElectionDatabase__AlreadyVoted();

        election.votesPerCandidate[_candidate]++;
        election.voterToChosenCandidate[msg.sender] = _candidate;
        election.voterHasVoted[msg.sender] = true;
        election.totalVotes++;

        // this mark voted function marks the voter, we don't want people
        // to change their identity after they have voted, so mark it on the
        // VoterDatabase, ideally this should be called once, and not per election
        s_voterDB.markVoted();

        emit VoterVoted(_electionId, msg.sender, _candidate);
    }

    /// @notice Returns the vote count of a candidate in a specific election
    function getVotesOfCandidate(
        uint256 _electionId,
        address _candidate
    ) external view onlyRegisteredElection(_electionId) returns (uint256) {
        return s_elections[_electionId].votesPerCandidate[_candidate];
    }

    /// @notice Returns whether the election is currently active
    function getElectionStatus(
        uint256 _electionId
    ) external view onlyRegisteredElection(_electionId) returns (bool) {
        return s_elections[_electionId].isActive;
    }

    /// @notice Returns name, description, status, and candidates of an election
    function getElectionDetails(
        uint256 _electionId
    )
        external
        view
        onlyRegisteredElection(_electionId)
        returns (
            string memory name,
            string memory description,
            bool isActive,
            address[] memory candidates
        )
    {
        Election storage election = s_elections[_electionId];
        return (
            election.name,
            election.description,
            election.isActive,
            election.candidates
        );
    }

    /// @notice Returns the total number of elections created
    function getElectionCount() external view returns (uint256) {
        return s_electionCounter;
    }

    /// @notice Returns the list of registered candidates for a given election
    function getRegisteredCandidates(
        uint256 _electionId
    )
        external
        view
        onlyRegisteredElection(_electionId)
        returns (address[] memory)
    {
        return s_elections[_electionId].candidates;
    }

    /// @notice Returns the total number of votes cast in an election
    function getTotalVoteCount(
        uint256 _electionId
    ) external view onlyRegisteredElection(_electionId) returns (uint256) {
        return s_elections[_electionId].totalVotes;
    }

    /// @notice Returns the winning candidate (highest votes) for a given election
    function getWinner(
        uint256 _electionId
    ) external view onlyRegisteredElection(_electionId) returns (address) {
        Election storage election = s_elections[_electionId];
        uint256 maxVotes = 0;
        address winnerAddress = address(0);

        for (uint256 i = 0; i < election.candidates.length; i++) {
            address candidate = election.candidates[i];
            uint256 votes = election.votesPerCandidate[candidate];
            if (votes > maxVotes) {
                maxVotes = votes;
                winnerAddress = candidate;
            }
        }

        return winnerAddress;
    }
}

